import React from "react";
import {Outlet} from "react-router-dom";
import Navbar from "../Navbar";
import Sidebar from "../Sidebar";

const Layout = () => {
    return (
        <>
            <Navbar />
            <div class="row row-offcanvas row-offcanvas-left vh-100">
            <Sidebar />
            </div>
            <Outlet />

        </>
    );
};

export default Layout;
